import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import '../style/Header.css';
import Filter from './Filter';

const Header = ({
  isSignedIn,
  handleSignIn,
  handleSignOut,
  genres,
  tempGenre,
  setTempGenre,
  developers,
  tempDeveloper,
  setTempDeveloper,
  publishers,
  tempPublisher,
  setTempPublisher,
  tempRatingRange,
  setTempRatingRange,
  applyFilters,
  searchTerm,
  setSearchTerm,
  gameTitles, // Array of game titles for autocomplete
}) => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(() => {
    const savedDarkMode = localStorage.getItem('darkMode');
    return savedDarkMode === 'true';
  });
  const [filteredSuggestions, setFilteredSuggestions] = useState([]);
  const [showSuggestions, setShowSuggestions] = useState(false);

  const navigate = useNavigate();

  const handleSignInClick = () => navigate('/signin');
  const handleSignUpClick = () => navigate('/signup');
  const toggleSidebar = () => setIsSidebarOpen((prev) => !prev);
  const onApplyFilters = () => {
    applyFilters();
    setIsSidebarOpen(false);
  };

  const toggleDarkMode = () => {
    setIsDarkMode((prevMode) => {
      const newDarkMode = !prevMode;
      localStorage.setItem('darkMode', newDarkMode);
      return newDarkMode;
    });
  };

  useEffect(() => {
    if (isDarkMode) {
      document.body.classList.add('dark-mode');
    } else {
      document.body.classList.remove('dark-mode');
    }
  }, [isDarkMode]);

  // Update suggestions when the search term changes
  useEffect(() => {
    if (searchTerm) {
      const suggestions = gameTitles.filter((title) =>
        title.toLowerCase().includes(searchTerm.toLowerCase())
      );
      setFilteredSuggestions(suggestions);
      setShowSuggestions(true);
    } else {
      setFilteredSuggestions([]);
      setShowSuggestions(false);
    }
  }, [searchTerm, gameTitles]);

  const handleSuggestionClick = (suggestion) => {
    setSearchTerm(suggestion);
    setShowSuggestions(false);
  };

  return (
    <div className="header">
      <button
        className="btn-menu"
        onClick={toggleSidebar}
        aria-label="Menu"
        aria-expanded={isSidebarOpen}
      >
        ‚ò∞
      </button>

      <div className="search-container">
        <input
          type="text"
          placeholder="Search..."
          className="search-bar"
          aria-label="Search games"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        {showSuggestions && (
          <ul className="autocomplete-suggestions">
            {filteredSuggestions.map((suggestion, index) => (
              <li
                key={index}
                onClick={() => handleSuggestionClick(suggestion)}
                className="autocomplete-suggestion"
              >
                {suggestion}
              </li>
            ))}
          </ul>
        )}
      </div>

      <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
        <button
          className="btn-close"
          onClick={toggleSidebar}
          aria-label="Close Menu"
        >
          ‚úñ
        </button>

        <Filter
          genres={genres}
          tempGenre={tempGenre}
          setTempGenre={setTempGenre}
          developers={developers}
          tempDeveloper={tempDeveloper}
          setTempDeveloper={setTempDeveloper}
          publishers={publishers}
          tempPublisher={setTempPublisher}
          setTempPublisher={setTempPublisher}
          tempRatingRange={tempRatingRange}
          setTempRatingRange={setTempRatingRange}
          onApplyFilters={onApplyFilters}
        />

        <button
          className="toggle-btn"
          onClick={toggleDarkMode}
          aria-label="Toggle Dark Mode"
        >
          {isDarkMode ? 'üåô' : '‚òÄÔ∏è'} Dark Mode
        </button>
      </div>

      <div className="auth-buttons">
        {isSignedIn ? (
          <button className="btn-signout" onClick={handleSignOut}>
            Sign Out
          </button>
        ) : (
          <>
            <button className="btn-signin" onClick={handleSignInClick}>
              Sign In
            </button>
            <button className="btn-signup" onClick={handleSignUpClick}>
              Sign Up
            </button>
          </>
        )}
      </div>
    </div>
  );
};

export default Header;
